import React, { useEffect, useState } from "react";
import axios from "axios";

const Header = () => {
  const [users, setUsers] = useState([]);

  useEffect(async () => {
    const getData = async () => {
        const res = await axios.get('http://localhost:3000/users');
        setUsers(res.data);
    }

    getData();
  }, []);

  return (
  <div>
    {users.map(el => {
        return (
            <div>
                <h1>{users.name}</h1>
                <h2>{users.surname}</h2>
                <p>{users.age}</p>
            </div>
        )
    })}
  </div>);
};

export default Header;
